import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Modal from 'react-bootstrap/Modal';
import Button from 'react-bootstrap/Button';

function OrdemServicoList() {
  const [data, setData] = useState([]);
  const [showModal, setShowModal] = useState(false);
  const [selectedOrdemServico, setSelectedOrdemServico] = useState(null);

  const handleShowModal = (ordemServico) => {
    setSelectedOrdemServico(ordemServico);
    setShowModal(true);
  };

  const handleCloseModal = () => {
    setSelectedOrdemServico(null);
    setShowModal(false);
  };

  const handleEdit = () => {
    // Implementar a lógica para editar a ordem de serviço aqui
  };

  const handleDelete = () => {
    // Implementar a lógica para excluir a ordem de serviço aqui
  };

  useEffect(() => {
    // Fazer uma chamada à sua API para buscar as ordens de serviço.
    axios.get('/api/ordem-servico') // Substitua pela URL da sua API
      .then((response) => {
        setData(response.data);
      })
      .catch((error) => {
        console.error('Erro ao buscar dados das ordens de serviço:', error);
      });
  }, []);

  return (
    <div>
      <table>
        <thead>
          <tr>
            <th>Número</th>
            <th>Título</th>
            <th>Descrição</th>
            <th>Prioridade</th>
            <th>Responsável</th>
            <th>Data de Início</th>
            <th>Data de Fim</th>
            <th>Status</th>
            <th>Ações</th>
          </tr>
        </thead>
        <tbody>
          {data.map((ordemServico) => (
            <tr key={ordemServico.numero}>
              <td>{ordemServico.numero}</td>
              <td>
                <a href="#" onClick={() => handleShowModal(ordemServico)}>
                  {ordemServico.titulo}
                </a>
              </td>
              <td>{ordemServico.descricao}</td>
              <td>{ordemServico.prioridade}</td>
              <td>{ordemServico.responsavel_id}</td>
              <td>{ordemServico.data_inicio}</td>
              <td>{ordemServico.data_fim}</td>
              <td>{ordemServico.status}</td>
              <td>
                <button onClick={handleEdit}>Editar</button>
                <button onClick={handleDelete}>Excluir</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      <Modal show={showModal} onHide={handleCloseModal}>
        <Modal.Header closeButton>
          <Modal.Title>Detalhes da Ordem de Serviço</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          {selectedOrdemServico && (
            <div>
              <p>Número: {selectedOrdemServico.numero}</p>
              <p>Título: {selectedOrdemServico.titulo}</p>
              <p>Descrição: {selectedOrdemServico.descricao}</p>
              <p>Prioridade: {selectedOrdemServico.prioridade}</p>
              <p>Responsável: {selectedOrdemServico.responsavel_id}</p>
              <p>Data de Início: {selectedOrdemServico.data_inicio}</p>
              <p>Data de Fim: {selectedOrdemServico.data_fim}</p>
              <p>Status: {selectedOrdemServico.status}</p>
            </div>
          )}
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={handleCloseModal}>
            Fechar
          </Button>
        </Modal.Footer>
      </Modal>
    </div>
  );
}

export default OrdemServicoList;
